  ]) AS (user_id, email, name, sources, first_seen, last_seen, activity_count, csv_data, created_at, updated_at)
) AS source
ON target.user_id = source.user_id
WHEN MATCHED THEN
  UPDATE SET
    name = COALESCE(source.name, target.name),
    sources = ARRAY(SELECT DISTINCT s FROM UNNEST(ARRAY_CONCAT(target.sources, source.sources)) AS s),
    last_seen = GREATEST(target.last_seen, source.last_seen),
    csv_data = ARRAY_CONCAT(target.csv_data, source.csv_data),
    updated_at = CURRENT_TIMESTAMP()
WHEN NOT MATCHED THEN
  INSERT (user_id, email, name, sources, first_seen, last_seen, activity_count, csv_data, created_at, updated_at)
  VALUES (source.user_id, source.email, source.name, source.sources, source.first_seen, source.last_seen, source.activity_count, source.csv_data, source.created_at, source.updated_at)
